SELECT Keyword 
FROM google_campaigns 
WHERE Quality_Score > 8;

SELECT Network, AVG(ROAS) as Average_ROAS
FROM google_campaigns
GROUP BY Network;

SELECT Campaign_Name 
FROM google_campaigns 
WHERE Search_Impr_Share > 15;

SELECT Location, AVG(Avg_CPC) as Average_CPC
FROM google_campaigns
GROUP BY Location;

SELECT Gender, SUM(Clicks) as Total_Clicks
FROM google_campaigns
GROUP BY Gender;

SELECT Network, Device, SUM(Impressions) as Total_Impressions
FROM google_campaigns
GROUP BY Network, Device;

SELECT Match_Type, AVG(Conv_Value) as Average_Conversion_Value
FROM google_campaigns
GROUP BY Match_Type;

SELECT Campaign_Name, Impression_Share
FROM google_campaigns
WHERE Impression_Share < 70;

SELECT Campaign_Name, SUM(Conv_Value) as Total_Conversion_Value
FROM google_campaigns
GROUP BY Campaign_Name;

SELECT Gender, AVG(Cost_Per_Conv) as Avg_Cost_Per_Conv
FROM google_campaigns
GROUP BY Gender;
